import React from 'react'

export default function Button() {
  return (
    <div className=" grid justify-self-end w-[130px] h-12 relative">
    <div className="w-[130px] h-12 left-0 top-0 absolute bg-[#0594ff] rounded-[15px] shadow" />
    <a href='#' className="left-[24px] top-[16px] absolute text-center text-white text-sm font-bold font-['Helvetica']">Get in touch</a>
  </div>
    
  )
}
